import React from 'react';

const ProductCard = ({ name, price, addToWishlist }) => {
  return (
    <div className="product-card">
      <h2>{name}</h2>
      <p>Price: ${price}</p>
      <button onClick={addToWishlist}>Add to Wishlist</button>
    </div>
  );
};

export default ProductCard;
